                    var file = files.FirstOrDefault();

                    if (file != null)
                    {
                        var ms = new MemoryStream();
                        await file.Data.CopyToAsync(ms);
                        ImgUploaded = ms.ToArray();
                    }
                }

                public async Task OpenDeleteModal(string modalId, int busItemId)
